import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes, useLocation } from 'react-router-dom';
import './App.css';

// Hook para resaltar la pesta침a activa
function useActiveLink(path) {
  const location = useLocation();
  return location.pathname === path ? 'active' : '';
}

// Componentes de las P치ginas
function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Contact() {
  return <h2>Contact</h2>;
}

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <nav>
            <ul className="tabs">
              <li><Link to="/" className={useActiveLink('/')}>Home</Link></li>
              <li><Link to="/about" className={useActiveLink('/about')}>About</Link></li>
              <li><Link to="/contact" className={useActiveLink('/contact')}>Contact</Link></li>
            </ul>
          </nav>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </header>
      </div>
    </Router>
  );
}

export default App;
